function Dump() {}

Dump.get = function(short_name) {
    if (!(short_name in Dump.storage)) {
        throw new Error('DUMP: Dump "' + short_name + '" not exists');
    }

    var dump = new Dump(),
        entry = Dump.storage[short_name];
	
    if (!(entry['data'] instanceof DataView)) {
	entry['data'] = new DataView(new Uint8ClampedArray(entry['data']).buffer);
    }
    
    for (var key in entry) {
        Object.defineProperty(dump, key, {
            enumerable : true,
            value : entry[key]
        });
    }
    
    return Object.freeze(dump);
};

Dump.list = function() {
    var storage = Dump.storage,
        list = {};

    Object.keys(storage).sort().forEach(function(key) {
        if (!storage[key].is_hidden) {
            list[key] = storage[key].name;
        }
    });

    return list;
};

